function getUser(userId){return new Promise((resolve,reject)=>{try{setTimeout(()=>{const user=1===userId?{id:userId,name:"Henson"}:null;resolve(user)},1e3)}catch(error){reject(error)}})}function runPromise(){getUser(0).then(user=>{user?console.log("user: ",user):console.log("유저가 없어요.")}).catch(err=>{console.log("err: ",err)})}async function runAsyncAwait(){try{const user=await getUser(0);user?console.log("user: ",user):console.log("유저가 없어요.")}catch(error){console.log("error: ",error)}}console.log("start"),runAsyncAwait(),console.log("end");